let img3 = 'https://picsum.photos/200/500';
let link = 'https://picsum.photos/';

ReactDom.render(
    <>
    <h1>satish here!</h1>
    <img src={img1} alt='random images' />
    <img src={img2} alt='random images'/>
    <a href= {link}  target='-'>
    <img src={img3} alt='random images'/>

    </a>
    </>,document.getElementById('root')
